INSERT INTO `coopmego_db_field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'noticia', 0, 5, 5, 'und', 0, 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nemo maiores explicabo animi laboriosam culpa ex aliquam quas. Atque tenetur nisi sunt consequatur. Ratione ea aperiam, consequatur omnis id delectus rem.', '', 'filtered_html'),
('node', 'noticia', 0, 6, 6, 'und', 0, '<h3><strong>¿Cómo realizar el pago?</strong></h3>\r\n\r\n<h3>Mediante débito de su cuenta de ahorros CoopMego, usted puede realizar el pago de valores por concepto de:</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>Telefonía fija y móvil</h3>\r\n	</li>\r\n	<li>\r\n	<h3>TV prepagada</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Internet</h3>\r\n	</li>\r\n</ul>\r\n\r\n<h3>Es importante que usted registre su cuenta de ahorros en las Oficinas de la CNT o en las Oficinas de CoopMego.</h3>\r\n\r\n<h3>Mediante el pago en efectivo en nuestra Oficinas, usted puede cancelar valores de los siguientes servicios:</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>Telefonía fija y móvil</h3>\r\n	</li>\r\n	<li>\r\n	<h3>TV prepagada</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Internet</h3>\r\n	</li>\r\n</ul>\r\n\r\n<h3>Es importante que usted presente el número del servicio.</h3>\r\n\r\n<h3>Mediante el Servicio de Transacciones Electrónicas MegOnline, usted puede realizar el pago de valores por concepto de:</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>Telefonía fija</h3>\r\n	</li>\r\n</ul>\r\n\r\n<h3>Solicite de forma gratuita la activación del Servicio MegOnline en una de nuestras Oficinas o si cuenta con el servicio ingrese a la página de la institución.</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', 'filtered_html'),
('node', 'noticia', 0, 7, 7, 'und', 0, '<h4>En todas las ventanillas de CoopMego usted puede realizar &nbsp;el pago de valores del Servicio de Rentas Internas (SRI):</h4>\r\n\r\n<ul>\r\n	<li>\r\n	<h4><em>IVA</em></h4>\r\n	</li>\r\n	<li>\r\n	<h4><em>RISE</em></h4>\r\n	</li>\r\n	<li>\r\n	<h4><em>Impuestos Fiscales (Otras Formas de Pago).</em></h4>\r\n	</li>\r\n	<li>\r\n	<h4><em>Matriculación Vehicular, Transferencia de Dominio y Ajustes.</em></h4>\r\n	</li>\r\n	<li>\r\n	<h4><em>Otros.</em></h4>\r\n	</li>\r\n</ul>\r\n\r\n<h4><strong>¿Cómo realizar el pago?</strong></h4>\r\n\r\n<h4><strong>Mediante débito de su cuenta de ahorros CoopMego</strong></h4>\r\n\r\n<ul>\r\n	<li>\r\n	<h4>Ingrese a la página web del SRI con su número de identificación y clave.</h4>\r\n	</li>\r\n	<li>\r\n	<h4>Acceda al menú “General” / “Declaraciones” / “Registro y/o actualización de cuentas bancarias”.</h4>\r\n	</li>\r\n	<li>\r\n	<h4>En la lista de instituciones financieras búsquenos como Manuel Esteban Godoy Ortega Ltda.</h4>\r\n	</li>\r\n	<li>\r\n	<h4>Registre los datos de su cuenta de ahorros CoopMego.</h4>\r\n	</li>\r\n</ul>\r\n\r\n<p><img alt=\"pago-sri\" class=\"alignnone size-full wp-image-2906\" src=\"https://www.coopmego.com/wp-content/uploads/2017/09/pago-sri.jpg\" /></p>\r\n\r\n<h4><strong>Mediante el pago en efectivo en nuestras Oficinas</strong></h4>\r\n\r\n<ul>\r\n	<li>\r\n	<h4>Presente en las ventanillas de CoopMego el código para el pago: número de RUC, Comprobante Electrónico para Pago (CEP) o número de placa del vehículo, según corresponda.</h4>\r\n	</li>\r\n</ul>\r\n\r\n<h4>&nbsp;</h4>\r\n', '', 'filtered_html'),
('node', 'noticia', 0, 8, 8, 'und', 0, '<h4>Crédito dirigido a socios emprendedores como usted, lo ayudamos a consolidar o ampliar su negocio o empresa. Financiamos capital de trabajo, adquisición de maquinaria, mobiliario, equipamiento, etc.</h4>\r\n\r\n<hr />\r\n<h4><strong>Beneficios:</strong></h4>\r\n\r\n<ul>\r\n	<li>Plazo hasta 10 años, dependiendo del monto del crédito y garantía.</li>\r\n	<li>Usted elige el día de pago de sus cuotas.</li>\r\n	<li>Cero costo por la cancelación anticipada de créditos.</li>\r\n	<li>Seguro de Desgravamen.</li>\r\n	<li>Seguro de Vida por sus Certificados de Aportación.</li>\r\n</ul>\r\n\r\n<h4><strong>Requisitos:</strong></h4>\r\n\r\n<ul>\r\n	<li>Fotocopia de Cédula de Ciudadanía y Certificado de Votación actualizados.</li>\r\n	<li>Fotocopia del pago de luz, agua o teléfono (de uno de los tres últimos meses).</li>\r\n	<li>Fotocopia del RUC O RISE.</li>\r\n	<li>Fotocopia de las tres últimas declaraciones del IVA o copias de facturas de proveedores de los tres últimos meses.</li>\r\n</ul>\r\n\r\n<h4>Condiciones:</h4>\r\n\r\n<ul>\r\n	<li>Ser propietario de un negocio establecido por lo menos un año.</li>\r\n</ul>\r\n', '', 'filtered_html'),
('node', 'page', 0, 12, 12, 'und', 0, 'La tarjeta Visa CoopMego ha sido específicamente concebida para superar sus más altas expectativas dándole a Usted un mayor poder de compra y la máxima flexibilidad para efectuar sus pagos. \r\n\r\n¿Por qué solicitar una tarjeta de crédito VISA Clásica de CoopMego?\r\n\r\n* Aceptada en más de 25 millones de establecimientos afiliados\r\n* Acceso a 750.000 cajeros automáticos en la RED PLUS\r\n* Realiza avances de efectivo cuando y donde tú lo necesites\r\n* Difiere tus consumos nacionales e internacionales en produbanco.com\r\n* Personaliza tu cupo para compras en el país, exterior e internet a través de produbanco.com \r\n* Regístrate en www.produbox.com, realiza tus compras en Estados Unidos y recíbelas en Ecuador\r\n* Escoge la fecha de corte de tu estado de cuenta, puede ser el 15 ó el 30 de cada mes\r\n* Realiza el pago total o mínimo (crédito rotativo)\r\n\r\nConsulta sobre seguro de viajes, reposición urgente de tarjeta y servicio de efectivo de emergencia en el Centro de Asistencia VISA, www.lac.visa.com  ', '', 'filtered_html'),
('node', 'page', 0, 13, 13, 'und', 0, '<p>Tarjeta Mastercard CoopMego te permitirá comprar en más de 28 millones de comercios afiliados a MasterCard en Ecuador y el mundo, la compra se debitará del saldo disponible de la cuenta corriente/ahorros pagando solamente lo que consume, sin recargos adicionales. Además con tu tarjeta PacifiCard puedes realizar en los cajeros de la CoopMego las siguientes transacciones:</p>\r\n\r\n<ul>\r\n	<li>Pago de tarjetas (MasterCard y Visa).</li>\r\n	<li>Compra de Pines y tiempo Aire para Celular (Claro, Movistar y CNT).</li>\r\n	<li>Pago de servicios básicos (Agua, luz y teléfono).</li>\r\n	<li>Pago de impuestos prediales.</li>\r\n	<li>Pago de matriculación vehicular y transferencia de dominio.</li>\r\n	<li>Pago de centros educativos y televisión pagada.</li>\r\n	<li>Retiros de Efectivo.</li>\r\n	<li>Consulta de saldos de cuenta corriente o de ahorros.</li>\r\n	<li>Transferencias entre cuentas del Banco</li>\r\n</ul>\r\n', '', 'filtered_html'),
('node', 'page', 0, 14, 14, 'und', 0, 'La Superintendencia de Compañías es el organismo técnico, con autonomía administrativa y económica, que vigila y controla la organización, actividades, funcionamiento, disolución y liquidación de las compañías y otras entidades en las circunstancias y condiciones establecidas por la Ley.\r\n\r\nLa Superitendencia de Compañías controla, vigila y promueve el mercado de valores, el sector societario y de seguros, mediante sistemas de regulación y servicios, contribuyendo al desarrollo confiable y transparente de la actividad empresarial en el país.', '', 'filtered_html'),
('node', 'page', 0, 19, 19, 'und', 0, '<p class=\"rtejustify\">La Cooperativa de Ahorro y Crédito Vicentina “Manuel Esteban Godoy Ortega” Ltda., CoopMego, nace del seno de la Sociedad Obreros Vicentinos de Loja, sus benefactores fueron los ilustres lojanos: Sr. Manuel Esteban Godoy Ortega, Monseñor Ángel Querubín Tinoco y Sr. Cornelio Samaniego, quienes aportaron económicamente con el propósito de contar con disponibilidades para la concesión de créditos de sus asociados.</p>\r\n\r\n<p class=\"rtejustify\"><a href=\"https://i2.wp.com/sociotrabajo.com/wp-content/uploads/2017/07/coopmego-loja.jpg?resize=600%2C250&amp;ssl=1\" target=\"_top\"><img alt=\"\" src=\"https://i2.wp.com/sociotrabajo.com/wp-content/uploads/2017/07/coopmego-loja.jpg?resize=600%2C250&amp;ssl=1\" /></a></p>\r\n\r\n<p class=\"rtejustify\">En el año 1984, bajo el liderazgo del Sr. Manuel Esteban Godoy Ortega, se lleva a efecto la Asamblea Constitutiva con la participación de 40 socios, designando como Presidente de la Pre-cooperativa al anteriormente citado líder, quien con el asesoramiento del Lic. Manuel Maldonado, en ese entonces Inspector de Cooperativas de Loja y Zamora Chinchipe, realizaron las gestiones tendientes a conseguir la personería jurídica de la Cooperativa.</p>\r\n\r\n<p class=\"rtejustify\">En 1985, la “Cooperativa de Ahorro y Crédito Vicentino de Loja” es calificada como entidad que realiza actividades de intermediación Financiera, según resolución de la Superintendencia de Bancos Nro. 85-143, publicada en el Registro Oficial Nro. 297 el 22 de octubre del mismo año.</p>\r\n\r\n<p class=\"rtejustify\"><br />\r\nEn 1986, por resolución de la Superintendencia de Bancos Nro. 86-093-DC, del 8 de enero del mismo año, pasa a llamarse “Cooperativa de Ahorro y Crédito Vicentina Manuel Esteban Godoy Ortega Ltda.”, ingresando a su control y permaneciendo en este estatus hasta 1992.<br />\r\nEl crecimiento y desarrollo alcanzado permitió a la Cooperativa reingresar al control y vigilancia de la Superintendencia de Bancos y Seguros a partir de 2003, lo que permitió fortalecer la confianza pública de sus socios y comunidad.</p>\r\n\r\n<p class=\"rtejustify\"><br />\r\nA partir de 2013 la Cooperativa pasa al control de la Superintendencia de Economía Popular y Solidaria, siendo este el principal ente regulador de control y de apoyo del Sistema Financiero Cooperativo Ecuatoriano.<br />\r\nCoopMego ha apoyado al desarrollo de la región sur del Ecuador, convirtiéndose en una de las primeras instituciones financieras; a la fecha contamos con Oficinas en las Provincias de Loja, Zamora Chinchipe, Azuay, El Oro y Morona Santiago.</p>\r\n', '', 'filtered_html'),
('node', 'page', 0, 20, 20, 'und', 0, '<p class=\"rtejustify\">Una&nbsp;cuenta de ahorro&nbsp;es un depósito ordinario a la vista (producto pasivo), en la que los fondos depositados por la cuenta, tienen disponibilidad inmediata y generan cierta rentabilidad o durante un periodo determinado según el monto ahorrado.<br />\r\nLas condiciones de remuneración varían en función del producto concreto. Así, pueden existir cuentas de ahorro que abonen los intereses por ejemplo mensual, trimestral o anualmente. Igualmente, la remuneración puede ser lineal (mismo interés para cualquier saldo), por tramos de saldo o incluso en especie.<br />\r\nEste tipo de cuentas también pueden estar sujetas al pago de comisiones, aunque desde la popularización de la&nbsp;banca online&nbsp;la tendencia es a suprimir el pago de comisiones en los productos de ahorro.<br />\r\nLos servicios asociados a una cuenta de ahorro también varían según la entidad. Pueden ir desde los más básicos, como ingresos y pagos de&nbsp;cheques&nbsp;o&nbsp;transferencias, hasta otros más complejos como&nbsp;tarjetas de débito&nbsp;o&nbsp;crédito&nbsp;asociadas a la cuenta.</p>\r\n\r\n<p class=\"rtejustify\">&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'page', 0, 21, 21, 'und', 0, '<p class=\"rtejustify\">La&nbsp;cuenta corriente&nbsp;(cta. cte.) es un contrato bancario donde el titular efectúa ingresos de fondos. Con una cuenta corriente se puede disponer de los depósitos ingresados de forma inmediata a través de&nbsp;talonarios,&nbsp;cajeros automáticos&nbsp;o la ventanilla de la&nbsp;caja&nbsp;o&nbsp;banco. Una cuenta que no genera intereses a favor del titular.De la cuenta corriente solo se puede retirar el dinero en&nbsp;cheque, en avances y en compras.<br />\r\nLa cuenta corriente para otra serie de operaciones con los bancos:</p>\r\n\r\n<ul>\r\n	<li class=\"rtejustify\">Al concederse un&nbsp;crédito&nbsp;queda reflejado en la cuenta corriente.</li>\r\n	<li class=\"rtejustify\">Se pueden domiciliar pagos a través de ella.</li>\r\n	<li class=\"rtejustify\">Se pueden realizar descuentos de efectos.</li>\r\n	<li class=\"rtejustify\">Cobrar intereses.</li>\r\n	<li class=\"rtejustify\">Pagar intereses.</li>\r\n	<li class=\"rtejustify\">Cobrar&nbsp;impuestos.</li>\r\n	<li class=\"rtejustify\">Pagar impuestos.</li>\r\n</ul>\r\n\r\n<p class=\"rtejustify\">Es una cuenta que se usa principalmente para ingresos del titular. Los medios de pago que se pueden utilizar asociados a las cuentas corrientes pueden ser:</p>\r\n\r\n<ul>\r\n	<li class=\"rtejustify\">Talonario de cheques.</li>\r\n	<li class=\"rtejustify\">Tarjeta de crédito.</li>\r\n	<li class=\"rtejustify\">Tarjeta de&nbsp;débito.</li>\r\n	<li class=\"rtejustify\">Monedero electrónico.</li>\r\n	<li class=\"rtejustify\">Pago mediante móvil.</li>\r\n</ul>\r\n\r\n<p class=\"rtejustify\">&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'page', 0, 22, 22, 'und', 0, '<p class=\"rtejustify\">La tarjeta de crédito es un medio de pago que te permite hacer compras que puedes pagar posteriormente (una semana después, un mes después, un año después, etc). Son llamadas “de crédito” porque cuando pagas cualquier mercancía con ella, el banco que te la otorgó te está concediendo un préstamo que debes pagar de acuerdo al periodo que elijas según los plazos negociados con la entidad. Es decir que si pagas con tu tarjeta por ejemplo una camisa que te gusto, por un valor de 100.000 pesos, le debes ese dinero al banco que expidió la tarjeta.</p>\r\n\r\n<p class=\"rtejustify\"><strong>Elementos esenciales</strong></p>\r\n\r\n<p class=\"rtejustify\"><strong>Cuota o Pago mínimo</strong>: Es el que el banco calcula cada mes, con relación a tu deuda, para determinar el monto mínimo que debes cancelar de tú crédito.</p>\r\n\r\n<p class=\"rtejustify\"><strong>Intereses:</strong> Es el costo que debes pagar por tu tarjeta de crédito. Lo encuentras como un valor adicional que se calcula cada mes sobre el saldo de tu tarjeta.</p>\r\n\r\n<p class=\"rtejustify\"><strong>Beneficios Adicionales:</strong> Dependiendo de tu entidad financiera, algunas tarjetas de crédito tienen beneficios adicionales como seguros para viajes o cobertura nacional, entre otros.</p>\r\n\r\n<p class=\"rtejustify\"><strong>Cupo:</strong> Es el tope máximo de dinero que puedo gastar con mi tarjeta de crédito.</p>\r\n\r\n<p class=\"rtejustify\"><strong>Corte:</strong> Fecha mensual, que toma el banco para hacer el cálculo de tu deuda, pago mínimo e interés, que aparecen en tu Estado de Cuenta. Por ejemplo, imagínate que tu fecha de corte son los días 30 de cada mes, en tu Estado de Cuenta llegarán todos los consumos que has realizado con tu tarjeta desde el 1 hasta el 30 del mes en curso, a esos consumos se les sumará los saldos anteriores y se calculará el pago mínimo y los intereses a pagar.</p>\r\n\r\n<p class=\"rtejustify\"><strong>Saldo:</strong> Es el dinero que debes al banco después de efectuar tus pagos mensuales de intereses, cuota mínima o abono a capital. Por ejemplo, si tu deuda de la tarjeta de de $200.000 pesos, tu pago mínimo de $30.000 y tus intereses de $10.000, tu saldo será de $170.000 pesos, resultantes de restar $200.000 - $30.000. Los intereses no se restan, porque corresponden al costo que estas pagando por tu crédito.</p>\r\n\r\n<p class=\"rtejustify\">&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'page', 0, 23, 23, 'und', 0, '<p class=\"rtejustify\">Un préstamo es una operación por la cual una entidad financiera pone a nuestra disposición una cantidad determinada de dinero mediante un contrato. En un préstamo nosotros adquirimos la obligación de devolver ese dinero en un plazo de tiempo establecido y de pagar unas comisiones e intereses acordados. Podemos devolver el dinero en uno o varios pagos, aunque, habitualmente, la cantidad se devuelve en cuotas mensuales que incluyen las comisiones y los intereses.</p>\r\n\r\n<p class=\"rtejustify\">Al hablar de préstamo, la cantidad de dinero que pedimos prestada se llama el ‘principal’, mientras que el ‘interés’ es el precio que pagamos por poder disponer de ese dinero. El periodo de tiempo para pagar el préstamo se conoce como el ‘plazo’.</p>\r\n\r\n<p class=\"rtejustify\">El ‘prestamista’ es la persona o entidad financiera que presta el dinero o el bien en concepto de préstamo. El ‘prestatario’ es la persona que recibe el dinero o el bien en concepto de préstamo.</p>\r\n\r\n<p class=\"rtejustify\">Según el artículo 1.740 del Código Civil, “Por el contrato de préstamo, una de las partes entrega a la otra, o alguna cosa no fungible para que use de ella por cierto tiempo y se la devuelva, en cuyo caso se llama comodato, o dinero u otra cosa fungible, con condición de devolver otro de la misma especie y calidad, en cuyo caso conserva simplemente el nombre de préstamo. El comodato es esencialmente gratuito. El simple préstamo puede ser gratuito o con pacto de pagar interés”.</p>\r\n\r\n<p class=\"rtejustify\">&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'page', 0, 24, 24, 'und', 0, '<p class=\"rtejustify\">La póliza es un documento con el cual se formalizan ciertos contratos de seguros o se registran las operaciones contables de una persona o empresa.La palabra, como tal, proviene del italiano <em>polizza</em>, que a su vez viene del griego bizantino πόδειξις (apódeixis), que significa ‘demostración’ o ‘prueba’.Una póliza también puede ser un sello, más específicamente se refiere a aquel que utiliza el Estado español para adjuntar a ciertos documentos oficiales (como certificados e instancias), con el fin de satisfacer el impuesto de timbre que se requiere en ellos.</p>\r\n\r\n<h2 class=\"rtejustify\">Póliza de seguro</h2>\r\n\r\n<p class=\"rtejustify\">Como póliza de seguro se conoce el documento legal que sirve de instrumento para certificar los beneficios a que accede un asegurado cuando paga una prima por la cobertura de un seguro. En la póliza de seguro, son fijados los términos por los cuales la agencia aseguradora se obliga a resarcir un daño y pagar una indemnización económica a una persona al verificarse una eventualidad prevista dentro del contrato.</p>\r\n\r\n<p class=\"rtejustify\">Existen distintos tipos de póliza de seguro: contra incendios, choques, accidentes, robos, pólizas de transporte, de enfermedad, de vida, de viaje, etc.</p>\r\n\r\n<h2 class=\"rtejustify\">Pólizas contables</h2>\r\n\r\n<p class=\"rtejustify\">En contabilidad, se denomina póliza contable a todo aquel documento en que son registradas todas las operaciones contables de una persona o empresa. Pueden ser de distintos tipos: de diario, de egresos o de ingresos.</p>\r\n\r\n<h3 class=\"rtejustify\">Póliza de diario</h3>\r\n\r\n<p class=\"rtejustify\">La póliza de diario es aquella en la cual son registrados los movimientos u operaciones de una empresa que, aunque afectan su economía, no implican movimiento (de entrada o de salida) de dinero.</p>\r\n\r\n<h3 class=\"rtejustify\">Póliza de egresos</h3>\r\n\r\n<p class=\"rtejustify\">La póliza de egresos es aquella que se utiliza para registrar operaciones de pagos o salidas de dinero de una empresa. Conviene acotar, sin embargo, que en caso de una salida de dinero en forma de cheque, la póliza en cuestión recibirá el nombre de póliza de cheque.</p>\r\n\r\n<h3 class=\"rtejustify\">Póliza de ingresos</h3>\r\n\r\n<p class=\"rtejustify\">Son pólizas de ingresos todas aquellas en que constan los registros del dinero que entra a la empresa, bien sea en efectivo, por cheque o transferencia.</p>\r\n', '', 'filtered_html');
