(5, 'node', ' nueva sucursal coopmego en punta centinela lorem ipsum dolor sit amet consectetur adipisicing elit nemo maiores explicabo animi laboriosam culpa ex aliquam quas atque tenetur nisi sunt consequatur ratione ea aperiam consequatur omnis id delectus rem  ', 0),
(6, 'node', ' pago facturas cnt  cómo realizar el pago  mediante débito de su cuenta de ahorros coopmego usted puede realizar el pago de valores por concepto de telefonía fija y móvil tv prepagada internet es importante que usted registre su cuenta de ahorros en las oficinas de la cnt o en las oficinas de coopmego mediante el pago en efectivo en nuestra oficinas usted puede cancelar valores de los siguientes servicios telefonía fija y móvil tv prepagada internet es importante que usted presente el número del servicio mediante el servicio de transacciones electrónicas megonline usted puede realizar el pago de valores por concepto de telefonía fija solicite de forma gratuita la activación del servicio megonline en una de nuestras oficinas o si cuenta con el servicio ingrese a la página de la institución ahora la coopmego te permite realizar el pago directo de tus facturas de telefonía e internet a través de nuestras oficinas y vía online  ', 0),
(7, 'node', ' pago de cuentas sri en todas las ventanillas de coopmego usted puede realizar el pago de valores del servicio de rentas internas sri  iva rise impuestos fiscales otras formas de pago  matriculación vehicular transferencia de dominio y ajustes otros  cómo realizar el pago  mediante débito de su cuenta de ahorros coopmego ingrese a la página web del sri con su número de identificación y clave acceda al menú general declaraciones registro y o actualización de cuentas bancarias en la lista de instituciones financieras búsquenos como manuel esteban godoy ortega ltda registre los datos de su cuenta de ahorros coopmego mediante el pago en efectivo en nuestras oficinas presente en las ventanillas de coopmego el código para el pago número de ruc comprobante electrónico para pago cep o número de placa del vehículo según corresponda ahora tu cooperativa te permite pagar directamente los valores e impuestos al servicio de rentas internas  ', 0),
(8, 'node', ' préstamo de empredendimiento crédito dirigido a socios emprendedores como usted lo ayudamos a consolidar o ampliar su negocio o empresa financiamos capital de trabajo adquisición de maquinaria mobiliario equipamiento etc beneficios  plazo hasta 10 años dependiendo del monto del crédito y garantía usted elige el día de pago de sus cuotas cero costo por la cancelación anticipada de créditos seguro de desgravamen seguro de vida por sus certificados de aportación requisitos  fotocopia de cédula de ciudadanía y certificado de votación actualizados fotocopia del pago de luz agua o teléfono de uno de los tres últimos meses fotocopia del ruc o rise fotocopia de las tres últimas declaraciones del iva o copias de facturas de proveedores de los tres últimos meses condiciones ser propietario de un negocio establecido por lo menos un año para tí que eres emprendedor te ofrecemos las tasas de interés más bajas con los mejores beneficios  ', 0),
(10, 'node', ' simulador de amortización monto plazo meses tipo de garantía seleccione garantia firmas hipotecas tipo de amortización seleccione la amortización a usar cuota fija francesa capital fijo alemana   simulador amortización  ', 0),
(12, 'node', ' tarjeta visa la tarjeta visa coopmego ha sido específicamente concebida para superar sus más altas expectativas dándole a usted un mayor poder de compra y la máxima flexibilidad para efectuar sus pagos por qué solicitar una tarjeta de crédito visa clásica de coopmego aceptada en más de 25 millones de establecimientos afiliados acceso a 750000 cajeros automáticos en la red plus realiza avances de efectivo cuando y donde tú lo necesites difiere tus consumos nacionales e internacionales en produbancocom personaliza tu cupo para compras en el país exterior e internet a través de produbancocom regístrate en wwwproduboxcom  realiza tus compras en estados unidos y recíbelas en ecuador escoge la fecha de corte de tu estado de cuenta puede ser el 15 ó el 30 de cada mes realiza el pago total o mínimo crédito rotativo consulta sobre seguro de viajes reposición urgente de tarjeta y servicio de efectivo de emergencia en el centro de asistencia visa  wwwlacvisacom ', 0),
(13, 'node', ' tarjeta mastercard tarjeta mastercard coopmego te permitirá comprar en más de 28 millones de comercios afiliados a mastercard en ecuador y el mundo la compra se debitará del saldo disponible de la cuenta corriente ahorros pagando solamente lo que consume sin recargos adicionales además con tu tarjeta pacificard puedes realizar en los cajeros de la coopmego las siguientes transacciones pago de tarjetas mastercard y visa compra de pines y tiempo aire para celular claro movistar y cnt pago de servicios básicos agua luz y teléfono pago de impuestos prediales pago de matriculación vehicular y transferencia de dominio pago de centros educativos y televisión pagada retiros de efectivo consulta de saldos de cuenta corriente o de ahorros transferencias entre cuentas del banco  ', 0),
(14, 'node', ' superitendencia de compañías la superintendencia de compañías es el organismo técnico con autonomía administrativa y económica que vigila y controla la organización actividades funcionamiento disolución y liquidación de las compañías y otras entidades en las circunstancias y condiciones establecidas por la ley la superitendencia de compañías controla vigila y promueve el mercado de valores el sector societario y de seguros mediante sistemas de regulación y servicios contribuyendo al desarrollo confiable y transparente de la actividad empresarial en el país  superitendencia compañías  ', 0),
(15, 'node', ' superitendencia de compañías superitendencia de compañías  superitendencia compañías  ', 0),
(16, 'node', ' coopmego https wwwcoopmegocom  ', 0),
(17, 'node', ' simuladores de amortización simulador de amortización ', 0),
(18, 'node', ' gobierno superitendencia de compañías ', 0),
(19, 'node', ' quiénes somos la cooperativa de ahorro y crédito vicentina manuel esteban godoy ortega ltda coopmego nace del seno de la sociedad obreros vicentinos de loja sus benefactores fueron los ilustres lojanos sr manuel esteban godoy ortega monseñor ángel querubín tinoco y sr cornelio samaniego quienes aportaron económicamente con el propósito de contar con disponibilidades para la concesión de créditos de sus asociados en el año 1984 bajo el liderazgo del sr manuel esteban godoy ortega se lleva a efecto la asamblea constitutiva con la participación de 40 socios designando como presidente de la precooperativa al anteriormente citado líder quien con el asesoramiento del lic manuel maldonado en ese entonces inspector de cooperativas de loja y zamora chinchipe realizaron las gestiones tendientes a conseguir la personería jurídica de la cooperativa en 1985 la cooperativa de ahorro y crédito vicentino de loja es calificada como entidad que realiza actividades de intermediación financiera según resolución de la superintendencia de bancos nro 85143 publicada en el registro oficial nro 297 el 22 de octubre del mismo año en 1986 por resolución de la superintendencia de bancos nro 86093dc del 8 de enero del mismo año pasa a llamarse cooperativa de ahorro y crédito vicentina manuel esteban godoy ortega ltda ingresando a su control y permaneciendo en este estatus hasta 1992 el crecimiento y desarrollo alcanzado permitió a la cooperativa reingresar al control y vigilancia de la superintendencia de bancos y seguros a partir de 2003 lo que permitió fortalecer la confianza pública de sus socios y comunidad a partir de 2013 la cooperativa pasa al control de la superintendencia de economía popular y solidaria siendo este el principal ente regulador de control y de apoyo del sistema financiero cooperativo ecuatoriano coopmego ha apoyado al desarrollo de la región sur del ecuador convirtiéndose en una de las primeras instituciones financieras a la fecha contamos con oficinas en las provincias de loja zamora chinchipe azuay el oro y morona santiago  ', 1521352767),
(20, 'node', ' cuenta de ahorro una cuenta de ahorro es un depósito ordinario a la vista producto pasivo en la que los fondos depositados por la cuenta tienen disponibilidad inmediata y generan cierta rentabilidad o durante un periodo determinado según el monto ahorrado las condiciones de remuneración varían en función del producto concreto así pueden existir cuentas de ahorro que abonen los intereses por ejemplo mensual trimestral o anualmente igualmente la remuneración puede ser lineal mismo interés para cualquier saldo por tramos de saldo o incluso en especie este tipo de cuentas también pueden estar sujetas al pago de comisiones aunque desde la popularización de la banca online la tendencia es a suprimir el pago de comisiones en los productos de ahorro los servicios asociados a una cuenta de ahorro también varían según la entidad pueden ir desde los más básicos como ingresos y pagos de cheques o transferencias hasta otros más complejos como tarjetas de débito o crédito asociadas a la cuenta  ', 1521352767),
(21, 'node', ' cuenta corriente la cuenta corriente cta cte es un contrato bancario donde el titular efectúa ingresos de fondos con una cuenta corriente se puede disponer de los depósitos ingresados de forma inmediata a través de talonarios cajeros automáticos o la ventanilla de la caja o banco una cuenta que no genera intereses a favor del titularde la cuenta corriente solo se puede retirar el dinero en cheque en avances y en compras la cuenta corriente para otra serie de operaciones con los bancos al concederse un crédito queda reflejado en la cuenta corriente se pueden domiciliar pagos a través de ella se pueden realizar descuentos de efectos cobrar intereses pagar intereses cobrar impuestos pagar impuestos es una cuenta que se usa principalmente para ingresos del titular los medios de pago que se pueden utilizar asociados a las cuentas corrientes pueden ser talonario de cheques tarjeta de crédito tarjeta de débito monedero electrónico pago mediante móvil  ', 0),
(22, 'node', ' tarjeta de crédito la tarjeta de crédito es un medio de pago que te permite hacer compras que puedes pagar posteriormente una semana después un mes después un año después etc son llamadas de crédito porque cuando pagas cualquier mercancía con ella el banco que te la otorgó te está concediendo un préstamo que debes pagar de acuerdo al periodo que elijas según los plazos negociados con la entidad es decir que si pagas con tu tarjeta por ejemplo una camisa que te gusto por un valor de 100000 pesos le debes ese dinero al banco que expidió la tarjeta elementos esenciales cuota o pago mínimo  es el que el banco calcula cada mes con relación a tu deuda para determinar el monto mínimo que debes cancelar de tú crédito intereses  es el costo que debes pagar por tu tarjeta de crédito lo encuentras como un valor adicional que se calcula cada mes sobre el saldo de tu tarjeta beneficios adicionales  dependiendo de tu entidad financiera algunas tarjetas de crédito tienen beneficios adicionales como seguros para viajes o cobertura nacional entre otros cupo  es el tope máximo de dinero que puedo gastar con mi tarjeta de crédito corte  fecha mensual que toma el banco para hacer el cálculo de tu deuda pago mínimo e interés que aparecen en tu estado de cuenta por ejemplo imagínate que tu fecha de corte son los días 30 de cada mes en tu estado de cuenta llegarán todos los consumos que has realizado con tu tarjeta desde el 1 hasta el 30 del mes en curso a esos consumos se les sumará los saldos anteriores y se calculará el pago mínimo y los intereses a pagar saldo  es el dinero que debes al banco después de efectuar tus pagos mensuales de intereses cuota mínima o abono a capital por ejemplo si tu deuda de la tarjeta de de 200000 pesos tu pago mínimo de 30000 y tus intereses de 10000 tu saldo será de 170000 pesos resultantes de restar 200000 30000 los intereses no se restan porque corresponden al costo que estas pagando por tu crédito  ', 0),
(23, 'node', ' préstamo un préstamo es una operación por la cual una entidad financiera pone a nuestra disposición una cantidad determinada de dinero mediante un contrato en un préstamo nosotros adquirimos la obligación de devolver ese dinero en un plazo de tiempo establecido y de pagar unas comisiones e intereses acordados podemos devolver el dinero en uno o varios pagos aunque habitualmente la cantidad se devuelve en cuotas mensuales que incluyen las comisiones y los intereses al hablar de préstamo la cantidad de dinero que pedimos prestada se llama el principal mientras que el interés es el precio que pagamos por poder disponer de ese dinero el periodo de tiempo para pagar el préstamo se conoce como el plazo el prestamista es la persona o entidad financiera que presta el dinero o el bien en concepto de préstamo el prestatario es la persona que recibe el dinero o el bien en concepto de préstamo según el artículo 1740 del código civil por el contrato de préstamo una de las partes entrega a la otra o alguna cosa no fungible para que use de ella por cierto tiempo y se la devuelva en cuyo caso se llama comodato o dinero u otra cosa fungible con condición de devolver otro de la misma especie y calidad en cuyo caso conserva simplemente el nombre de préstamo el comodato es esencialmente gratuito el simple préstamo puede ser gratuito o con pacto de pagar interés  ', 0),
(24, 'node', ' póliza la póliza es un documento con el cual se formalizan ciertos contratos de seguros o se registran las operaciones contables de una persona o empresala palabra como tal proviene del italiano polizza  que a su vez viene del griego bizantino πόδειξις apódeixis que significa demostración o prueba una póliza también puede ser un sello más específicamente se refiere a aquel que utiliza el estado español para adjuntar a ciertos documentos oficiales como certificados e instancias con el fin de satisfacer el impuesto de timbre que se requiere en ellos póliza de seguro como póliza de seguro se conoce el documento legal que sirve de instrumento para certificar los beneficios a que accede un asegurado cuando paga una prima por la cobertura de un seguro en la póliza de seguro son fijados los términos por los cuales la agencia aseguradora se obliga a resarcir un daño y pagar una indemnización económica a una persona al verificarse una eventualidad prevista dentro del contrato existen distintos tipos de póliza de seguro contra incendios choques accidentes robos pólizas de transporte de enfermedad de vida de viaje etc pólizas contables en contabilidad se denomina póliza contable a todo aquel documento en que son registradas todas las operaciones contables de una persona o empresa pueden ser de distintos tipos de diario de egresos o de ingresos póliza de diario la póliza de diario es aquella en la cual son registrados los movimientos u operaciones de una empresa que aunque afectan su economía no implican movimiento de entrada o de salida de dinero póliza de egresos la póliza de egresos es aquella que se utiliza para registrar operaciones de pagos o salidas de dinero de una empresa conviene acotar sin embargo que en caso de una salida de dinero en forma de cheque la póliza en cuestión recibirá el nombre de póliza de cheque póliza de ingresos son pólizas de ingresos todas aquellas en que constan los registros del dinero que entra a la empresa bien sea en efectivo por cheque o transferencia  ', 0),
(25, 'node', ' cuenta de ahorro cuenta de ahorro ', 0),
(26, 'node', ' quiénes somos quiénes somos ', 0);
